cordova.define("com.jiedaibao.systeminfo.SystemInfo", function (require, exports, module) {
   var exec = require('cordova/exec');
   module.exports = {
       addSystemInfoObserver : function(name, moduleUrl, successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'SystemInfo',
            'addSystemInfoObserver',
            [{
             "name": name,
             "moduleUrl": moduleUrl
             }]
            );
       },
       removeSystemInfoObserver : function(name, successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'SystemInfo',
            'removeSystemInfoObserver',
            [{
             "name": name
             }]
            );
       }
    }
  }
);
